import React from "react";
import routes from "routes";
import DefaultNavbar from "examples/Navbars/DefaultNavbar";
import MKBox from "components/MKBox";
import MKTypography from "components/MKTypography";

import bgImage from "assets/images/bg-sign-in.jpeg";
function Reservation(){
    return(<><DefaultNavbar
        routes={routes}
        action={{
            type: "internal",
            route: "/register",
            label: "Register Now",
            color: "error",
        }}
        transparent
        light /><MKBox
            position="absolute"
            top={0}
            left={0}
            zIndex={1}
            width="100%"
            minHeight="100vh"
            sx={{
                backgroundImage: ({ functions: { linearGradient, rgba }, palette: { gradients } }) => `${linearGradient(
                    rgba(gradients.dark.main, 0.6),
                    rgba(gradients.dark.state, 0.6)
                )}, url(${bgImage})`,
                backgroundSize: "cover",
                backgroundPosition: "center",
                backgroundRepeat: "no-repeat",
            }} />
            {/* Options de filtrage */}
      <select name="category" value={filterValues.category} onChange={handleFilterChange}>
        <option value="">Toutes les catégories</option>
        <option value="electronics">Électronique</option>
        <option value="clothing">Vêtements</option>
        {/* Ajoutez d'autres options de catégorie ici */}
      </select>

      <input type="text" name="price" placeholder="Prix maximum" value={filterValues.price} onChange={handleFilterChange} />

      <select name="rating" value={filterValues.rating} onChange={handleFilterChange}>
        <option value="">Tous les ratings</option>
        <option value="5">5 étoiles</option>
        <option value="4">4 étoiles</option>
        {/* Ajoutez d'autres options de rating ici */}
      </select>

      {/* Bouton pour appliquer le filtre */}
      <button onClick={filterData}>Appliquer le filtre</button>

      {/* Résultats filtrés */}
      {/* Affichez ici les résultats filtrés en fonction des valeurs des filtres sélectionnés */}
            </>);
}
export default Reservation;
